import React, {useState} from 'react'
import{
    NavbarContainer, 
    LeftContainer, 
    NavbarInnerContainer, 
    NavbarExtendedContainer, 
    NavbarLinkContainer, 
    NavbarLink,
    OpenLinkButton,
    NavbarLinkExtended
} from '../Navbar.styles'

const Navigation = () =>{

    const [extendNavbar, setExtendNavbar] = useState(false);
    return (
    <NavbarContainer extendNavbar ={extendNavbar}> 
        <NavbarInnerContainer>
            <LeftContainer>
                <OpenLinkButton 
                    onClick={() => {
                        setExtendNavbar((curr) => !curr)
                    }}
                > 
                    {extendNavbar ? <> &#10005; </> : <> &#8801;</>}
                </OpenLinkButton>

                <NavbarLinkContainer>
                    <NavbarLink to="/"> Home</NavbarLink>
                    <NavbarLink to="/products"> Products</NavbarLink>
                    <NavbarLink to="/contact-us"> Contact Us</NavbarLink>
                    <NavbarLink to="/about-us"> About Us</NavbarLink>
               </NavbarLinkContainer> 

            </LeftContainer>
        </NavbarInnerContainer>
        {extendNavbar && (
        <NavbarExtendedContainer>
            <NavbarLinkExtended to="/"> Task Management</NavbarLinkExtended>
            <NavbarLinkExtended to="/loginPage"> Login</NavbarLinkExtended>
            <NavbarLinkExtended to="/registrationPage"> Registration</NavbarLinkExtended>
            <NavbarLinkExtended to="/taskApp"> Task Manager</NavbarLinkExtended>
        </NavbarExtendedContainer>
        )}
    </NavbarContainer>
  )
}

export default Navigation;
